import React from "react";
import { useNavigate } from "react-router-dom";
import logo from '../Home/Assets/logo3.jpg'
import '../Header/Header.css'


function Header(){
    const navigate1= useNavigate()
    const Home = ()=>{navigate1('/')}

    const navigate2= useNavigate()
    const Facility=()=>{navigate2('/facility')}

    const navigate3= useNavigate()
    const Appointment=()=>{navigate3('/appointment')}


    return(
    <div className="nav-sec">
     <header className="nav-head">
       
        <div className="nav-logo" ><img src={logo}></img>
           <h2>Hope Care</h2></div>
     
        <div className="nav-button">
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
        
<div><button onClick={Home}><h6>Home</h6></button></div>
<div><button onClick={Facility}><h6>Facility</h6></button></div>
<div><button onClick={Appointment}><h6>Appointment</h6></button></div>
</div>
</header>
    </div>
    )
}

export default Header
